import React from "react";
import "./Product.css";
function Product() {
  return (
    <>
      <div className="containerProducts">
        <h1 className="product">
          <span>Latest</span> Products
        </h1>
      </div>
      <div className="container">
        <div className="row">
          <div className="col-md-3">sdf</div>
          <div className="col-md-9">asdfs</div>
        </div>
      </div>
    </>
  );
}

export default Product;
